.
Wout van Aert vence pela segunda vez no Tour de France 2020 e se confirma como uma das sensações do momento na temporada, depois se posicionar inteligentemente na frente do pelotão nos metros finais da corrida para ser o mais forte de um grupo reduzido de velocistas. 
.
A etapa 7, que teve como protagonistas os ventos cruzados e um ritmo alucinante da equipe Bora-Hansgrohe na frente do pelotão no começo da prova, viu a corrida se dividindo em três grupos e tirando as chances de vários velocistas disputarem a vitória, entre eles, Caleb Ewan (Lotto-Soudal), Alexander Kristoff (UAE Team Emirates) e Giacomo Nizzolo (NTT Cycling).
.
Vários concorrentes a Geral tiveram problemas na etapa de hoje, como Mikel Landa (Bahrain McLaren), Tadej Pogacar (UAE Team Emirates), Richie Porte e Bauke Mollema (Trek-Segafredo) e Esteban Chaves (Mitchelton-Scott) e perderam tempos importantes na Classificação, que continua com Adam Yates (Mitchelton-Scott) na liderança e Primoz Roglic (Jumbo-Visma) em segundo. Agora, Guillaume Martin subiu para terceiro. 
.
