Se entiende por entrenamiento en ayunas aquel que se realiza tras no haber ingerido nada de alimento en al menos 6 horas. Es decir, aquel que podemos realizar al levantarnos por la mañana. Los que están a favor de está modalidad de entrenamiento defienden que salir en bici en ayunas ayuda a que nuestro organismo aprenda a quemar grasa y podamos adelgazar y estar más finos. Además entrenar en ayunas nos hará más eficientes ya que nuestro cuerpo sabrá convertir la grasa en energía cuando no disponga de azucares u otras fuentes de energía rápida.

